import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Welcome to Matty</h1>
      <nav>
        <Link to="/dashboard">Dashboard</Link> | <Link to="/editor">Editor</Link>
      </nav>
    </div>
  );
}
export default Home;
